import{_ as e,o as t,c as a,Q as o}from"./chunks/framework.01af844e.js";const f=JSON.parse('{"title":"Incoming Request Data","description":"","frontmatter":{},"headers":[],"relativePath":"python/flask/api_reference/request_data.md","filePath":"python/flask/api_reference/request_data.md","lastUpdated":1693404008000}'),r={name:"python/flask/api_reference/request_data.md"},s=o('<h1 id="incoming-request-data" tabindex="-1">Incoming Request Data <a class="header-anchor" href="#incoming-request-data" aria-label="Permalink to &quot;Incoming Request Data {#incoming-request-data}&quot;">​</a></h1><h2 id="class-flask-request-environ-populate-request-true-shallow-false" tabindex="-1"><code>class</code> flask.Request(<code>environ, populate_request=True, shallow=False</code>) <a class="header-anchor" href="#class-flask-request-environ-populate-request-true-shallow-false" aria-label="Permalink to &quot;`class` flask.Request(`environ, populate_request=True, shallow=False`)&quot;">​</a></h2><p>The request object used by default in Flask. Remembers the matched endpoint and view arguments.</p><p>It is what ends up as request. If you want to replace the request object used you can subclass this and set <code>request_class</code> to your subclass.</p><p>The request object is a <code>Request</code> subclass and provides all of the attributes <code>Werkzeug</code> defines plus a few <code>Flask</code> specific ones.</p><ul><li><p><em>Parameters</em>:</p><ul><li><p><code>environ (WSGIEnvironment)</code> –</p></li><li><p><code>populate_request (bool)</code> –</p></li><li><p><code>shallow (bool)</code> –</p></li></ul></li><li><h3 id="property-accept-charsets-charsetaccept" tabindex="-1"><code>property</code> accept_charsets: <code>CharsetAccept</code> <a class="header-anchor" href="#property-accept-charsets-charsetaccept" aria-label="Permalink to &quot;`property` accept_charsets: `CharsetAccept`&quot;">​</a></h3></li></ul><p>List of charsets this client supports as <code>CharsetAccept</code> object.</p><ul><li><h3 id="property-accept-encodings-accept" tabindex="-1"><code>property</code> accept_encodings: <code>Accept</code> <a class="header-anchor" href="#property-accept-encodings-accept" aria-label="Permalink to &quot;`property` accept_encodings: `Accept`&quot;">​</a></h3></li></ul><p>List of encodings this client accepts. Encodings in a <code>HTTP</code> term are compression encodings such as gzip. For charsets have a look at <code>accept_charset</code>.</p><ul><li><h3 id="property-accept-languages-languageaccept" tabindex="-1"><code>property</code> accept_languages: <code>LanguageAccept</code> <a class="header-anchor" href="#property-accept-languages-languageaccept" aria-label="Permalink to &quot;`property` accept_languages: `LanguageAccept`&quot;">​</a></h3></li></ul><p>List of languages this client accepts as <code>LanguageAccept</code> object.</p><ul><li><h3 id="property-accept-mimetypes-mimeaccept" tabindex="-1"><code>property</code> accept_mimetypes: <code>MIMEAccept</code> <a class="header-anchor" href="#property-accept-mimetypes-mimeaccept" aria-label="Permalink to &quot;`property` accept_mimetypes: `MIMEAccept`&quot;">​</a></h3></li></ul><p>List of mimetypes this client supports as <code>MIMEAccept</code> object.</p><ul><li><h3 id="access-control-request-headers" tabindex="-1">access_control_request_headers <a class="header-anchor" href="#access-control-request-headers" aria-label="Permalink to &quot;access_control_request_headers&quot;">​</a></h3></li></ul><p>Sent with a preflight request to indicate which headers will be sent with the cross origin request. Set <code>access_control_allow_headers</code> on the response to indicate which headers are allowed.</p><ul><li><h3 id="access-control-request-method" tabindex="-1">access_control_request_method <a class="header-anchor" href="#access-control-request-method" aria-label="Permalink to &quot;access_control_request_method&quot;">​</a></h3></li></ul><p>Sent with a preflight request to indicate which method will be used for the cross origin request. Set <code>access_control_allow_methods</code> on the response to indicate which methods are allowed.</p><ul><li><h3 id="property-access-route-list-str" tabindex="-1"><code>property</code> access_route: <code>list[str]</code> <a class="header-anchor" href="#property-access-route-list-str" aria-label="Permalink to &quot;`property` access_route: `list[str]`&quot;">​</a></h3></li></ul><p>If a forwarded header exists this is a list of all ip addresses from the client ip to the last proxy server.</p><ul><li><h3 id="classmethod-application-f" tabindex="-1"><code>classmethod</code> application(<code>f</code>) <a class="header-anchor" href="#classmethod-application-f" aria-label="Permalink to &quot;`classmethod` application(`f`)&quot;">​</a></h3><p>Decorate a function as responder that accepts the request as the last argument. This works like the <code>responder()</code> decorator but the function is passed the request object as the last argument and the request object will be closed automatically:</p><div class="language-python vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">python</span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#B392F0;">@Request.application</span></span>\n<span class="line"><span style="color:#F97583;">def</span><span style="color:#E1E4E8;"> </span><span style="color:#B392F0;">my_wsgi_app</span><span style="color:#E1E4E8;">(request):</span></span>\n<span class="line"><span style="color:#E1E4E8;">    </span><span style="color:#F97583;">return</span><span style="color:#E1E4E8;"> Response(</span><span style="color:#9ECBFF;">&#39;Hello World!&#39;</span><span style="color:#E1E4E8;">)</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#6F42C1;">@Request.application</span></span>\n<span class="line"><span style="color:#D73A49;">def</span><span style="color:#24292E;"> </span><span style="color:#6F42C1;">my_wsgi_app</span><span style="color:#24292E;">(request):</span></span>\n<span class="line"><span style="color:#24292E;">    </span><span style="color:#D73A49;">return</span><span style="color:#24292E;"> Response(</span><span style="color:#032F62;">&#39;Hello World!&#39;</span><span style="color:#24292E;">)</span></span></code></pre></div><p>As of <code>Werkzeug</code> 0.14 <code>HTTP</code> exceptions are automatically caught and converted to responses instead of failing.</p><p><em>Parameters</em>:</p><ul><li>f (<code>t.Callable[[Request], WSGIApplication]</code>) – the <code>WSGI</code> callable to decorate</li></ul><p>Returns: a new <code>WSGI</code> callable</p><p><em>Return type</em>: <code>WSGIApplication</code></p></li><li><h3 id="property-args-multidict-str-str" tabindex="-1"><code>property</code> args: <code>MultiDict[str, str]</code> <a class="header-anchor" href="#property-args-multidict-str-str" aria-label="Permalink to &quot;`property` args: `MultiDict[str, str]`&quot;">​</a></h3><p>The parsed URL parameters (the part in the URL after the question mark).</p><p>By default an <code>ImmutableMultiDict</code> is returned from this function. This can be changed by setting <code>parameter_storage_class</code> to a different type. This might be necessary if the order of the form data is important.</p><p><em>Changed in version 2.3</em>: Invalid bytes remain percent encoded.</p></li><li><h3 id="property-authorization-authorization-none" tabindex="-1"><code>property</code> authorization: <code>Authorization | None</code> <a class="header-anchor" href="#property-authorization-authorization-none" aria-label="Permalink to &quot;`property` authorization: `Authorization | None`&quot;">​</a></h3><p>The Authorization header parsed into an Authorization object. None if the header is not present.</p><p><em>Changed in version 2.3</em>: Authorization is no longer a dict. The token attribute was added for auth schemes that use a token instead of parameters.</p></li><li><h3 id="property-base-url-str" tabindex="-1"><code>property</code> base_url: <code>str</code> <a class="header-anchor" href="#property-base-url-str" aria-label="Permalink to &quot;`property` base_url: `str`&quot;">​</a></h3><p>Like url but without the query string.</p></li><li><h3 id="property-blueprint-str-none" tabindex="-1"><code>property</code> blueprint: <code>str | None</code> <a class="header-anchor" href="#property-blueprint-str-none" aria-label="Permalink to &quot;`property` blueprint: `str | None`&quot;">​</a></h3><p>The registered name of the current blueprint.</p><p>This will be <code>None</code> if the endpoint is not part of a blueprint, or if URL matching failed or has not been performed yet.</p><p>This does not necessarily match the name the blueprint was created with. It may have been nested, or registered with a different name.</p></li><li><h3 id="property-blueprints-list-str" tabindex="-1"><code>property</code> blueprints: <code>list[str]</code> <a class="header-anchor" href="#property-blueprints-list-str" aria-label="Permalink to &quot;`property` blueprints: `list[str]`&quot;">​</a></h3><p>The registered names of the current blueprint upwards through parent blueprints.</p><p>This will be an empty list if there is no current blueprint, or if URL matching failed.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 2.0.1.</em></p></details></li><li><h3 id="property-cache-control-requestcachecontrol" tabindex="-1"><code>property</code> cache_control: <code>RequestCacheControl</code> <a class="header-anchor" href="#property-cache-control-requestcachecontrol" aria-label="Permalink to &quot;`property` cache_control: `RequestCacheControl`&quot;">​</a></h3><p>A <code>RequestCacheControl</code> object for the incoming cache control headers.</p></li><li><h3 id="property-charset-str" tabindex="-1"><code>property</code> charset: <code>str</code> <a class="header-anchor" href="#property-charset-str" aria-label="Permalink to &quot;`property` charset: `str`&quot;">​</a></h3><p>The charset used to decode body, form, and cookie data. Defaults to <code>UTF-8</code>.</p><p><em>Deprecated since version 2.3</em>: Will be removed in <code>Werkzeug</code> 3.0. Request data must always be <code>UTF-8</code>.</p></li><li><h3 id="close" tabindex="-1">close() <a class="header-anchor" href="#close" aria-label="Permalink to &quot;close()&quot;">​</a></h3><p>Closes associated resources of this request object. This closes all file handles explicitly. You can also use the request object in a with statement which will automatically close it.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.9.</em></p></details><p><em>Return type</em>: <code>None</code></p></li><li><h3 id="content-encoding" tabindex="-1">content_encoding <a class="header-anchor" href="#content-encoding" aria-label="Permalink to &quot;content_encoding&quot;">​</a></h3><p>The <code>Content-Encoding</code> entity-header field is used as a modifier to the media-type. When present, its value indicates what additional content codings have been applied to the entity-body, and thus what decoding mechanisms must be applied in order to obtain the media-type referenced by the <code>Content-Type</code> header field.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.9.</em></p></details></li><li><h3 id="property-content-length-int-none" tabindex="-1"><code>property</code> content_length: <code>int | None</code> <a class="header-anchor" href="#property-content-length-int-none" aria-label="Permalink to &quot;`property` content_length: `int | None`&quot;">​</a></h3><p>The <code>Content-Length</code> entity-header field indicates the size of the entity-body in bytes or, in the case of the <code>HEAD</code> method, the size of the entity-body that would have been sent had the request been a <code>GET</code>.</p></li><li><h3 id="content-md5" tabindex="-1">content_md5 <a class="header-anchor" href="#content-md5" aria-label="Permalink to &quot;content_md5&quot;">​</a></h3><p>The <code>Content-MD5</code> entity-header field, as defined in <code>RFC 1864</code>, is an <code>MD5</code> digest of the entity-body for the purpose of providing an end-to-end message integrity check (MIC) of the entity-body. (Note: a <code>MIC</code> is good for detecting accidental modification of the entity-body in transit, but is not proof against malicious attacks.)</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.9.</em></p></details></li><li><h3 id="content-type" tabindex="-1">content_type <a class="header-anchor" href="#content-type" aria-label="Permalink to &quot;content_type&quot;">​</a></h3><p>The <code>Content-Type</code> entity-header field indicates the media type of the entity-body sent to the recipient or, in the case of the <code>HEAD</code> method, the media type that would have been sent had the request been a <code>GET</code>.</p></li><li><h3 id="property-cookies-immutablemultidict-str-str" tabindex="-1"><code>property</code> cookies: <code>ImmutableMultiDict[str, str]</code> <a class="header-anchor" href="#property-cookies-immutablemultidict-str-str" aria-label="Permalink to &quot;`property` cookies: `ImmutableMultiDict[str, str]`&quot;">​</a></h3><p>A dict with the contents of all cookies transmitted with the request.</p></li><li><h3 id="property-data-bytes" tabindex="-1"><code>property</code> data: <code>bytes</code> <a class="header-anchor" href="#property-data-bytes" aria-label="Permalink to &quot;`property` data: `bytes`&quot;">​</a></h3><p>The raw data read from stream. Will be empty if the request represents form data.</p><p>To get the raw data even if it represents form data, use <code>get_data()</code>.</p></li><li><h3 id="date" tabindex="-1">date <a class="header-anchor" href="#date" aria-label="Permalink to &quot;date&quot;">​</a></h3><p>The Date general-header field represents the date and time at which the message was originated, having the same semantics as orig-date in RFC 822.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.0</em>: The datetime object is timezone-aware.</p></details></li><li><h3 id="dict-storage-class" tabindex="-1">dict_storage_class <a class="header-anchor" href="#dict-storage-class" aria-label="Permalink to &quot;dict_storage_class&quot;">​</a></h3><p>alias of <code>ImmutableMultiDict</code></p></li><li><h3 id="property-encoding-errors-str" tabindex="-1"><code>property</code> encoding_errors: <code>str</code> <a class="header-anchor" href="#property-encoding-errors-str" aria-label="Permalink to &quot;`property` encoding_errors: `str`&quot;">​</a></h3><p>How errors when decoding bytes are handled. Defaults to <code>“replace”</code>.</p><p><em>Deprecated since version 2.3</em>: Will be removed in <code>Werkzeug</code> 3.0.</p></li><li><h3 id="property-endpoint-str-none" tabindex="-1"><code>property</code> endpoint: <code>str | None</code> <a class="header-anchor" href="#property-endpoint-str-none" aria-label="Permalink to &quot;`property` endpoint: `str | None`&quot;">​</a></h3><p>The endpoint that matched the request URL.</p><p>This will be <code>None</code> if matching failed or has not been performed yet.</p><p>This in combination with <code>view_args</code> can be used to reconstruct the same URL or a modified URL.</p></li><li><h3 id="environ-wsgienvironment" tabindex="-1">environ: <code>WSGIEnvironment</code> <a class="header-anchor" href="#environ-wsgienvironment" aria-label="Permalink to &quot;environ: `WSGIEnvironment`&quot;">​</a></h3><p>The <code>WSGI</code> environment containing <code>HTTP</code> headers and information from the <code>WSGI</code> server.</p></li><li><h3 id="property-files-immutablemultidict-str-filestorage" tabindex="-1"><code>property</code> files: <code>ImmutableMultiDict[str, FileStorage]</code> <a class="header-anchor" href="#property-files-immutablemultidict-str-filestorage" aria-label="Permalink to &quot;`property` files: `ImmutableMultiDict[str, FileStorage]`&quot;">​</a></h3><p><code>MultiDict</code> object containing all uploaded files. Each key in files is the name from the <code>&lt;input type=&quot;file&quot; name=&quot;&quot;&gt;</code>. Each value in <code>files</code> is a <code>Werkzeug</code> <code>FileStorage</code> object.</p><p>It basically behaves like a standard file object you know from Python, with the difference that it also has a <code>save()</code> function that can store the file on the filesystem.</p><p>Note that files will only contain data if the request method was <code>POST</code>, <code>PUT</code> or <code>PATCH</code> and the <code>&lt;form&gt;</code> that posted to the request had <code>enctype=&quot;multipart/form-data&quot;</code>. It will be empty otherwise.</p><p>See the <code>MultiDict / FileStorage</code> documentation for more details about the used data structure.</p></li><li><h3 id="property-form-immutablemultidict-str-str" tabindex="-1"><code>property</code> form: <code>ImmutableMultiDict[str, str]</code> <a class="header-anchor" href="#property-form-immutablemultidict-str-str" aria-label="Permalink to &quot;`property` form: `ImmutableMultiDict[str, str]`&quot;">​</a></h3><p>The form parameters. By default an <code>ImmutableMultiDict</code> is returned from this function. This can be changed by setting <code>parameter_storage_class</code> to a different type. This might be necessary if the order of the form data is important.</p><p>Please keep in mind that file uploads will not end up here, but instead in the files attribute.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 0.9</em>: Previous to <code>Werkzeug</code> 0.9 this would only contain form data for <code>POST</code> and <code>PUT</code> requests.</p></details></li><li><h3 id="form-data-parser-class" tabindex="-1">form_data_parser_class <a class="header-anchor" href="#form-data-parser-class" aria-label="Permalink to &quot;form_data_parser_class&quot;">​</a></h3><p>alias of <code>FormDataParser</code></p></li><li><h3 id="classmethod-from-values-args-kwargs" tabindex="-1"><code>classmethod</code> from_values(<code>*args, **kwargs</code>) <a class="header-anchor" href="#classmethod-from-values-args-kwargs" aria-label="Permalink to &quot;`classmethod` from_values(`*args, **kwargs`)&quot;">​</a></h3><p>Create a new request object based on the values provided. If environ is given missing values are filled from there. This method is useful for small scripts when you need to simulate a request from an URL. Do not use this method for unittesting, there is a full featured client object (<code>Client</code>) that allows to create <code>multipart</code> requests, support for cookies etc.</p><p>This accepts the same options as the <code>EnvironBuilder</code>.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 0.5</em>: This method now accepts the same arguments as <code>EnvironBuilder</code>. Because of this the <code>environ</code> parameter is now called <code>environ_overrides</code>.</p></details><p><em>Returns</em>: request object</p><p><em>Parameters</em>:</p><ul><li><p><code>args (Any)</code> –</p></li><li><p><code>kwargs (Any)</code> –</p></li></ul><p><em>Return type</em>: <code>Request</code></p></li><li><h3 id="property-full-path-str" tabindex="-1"><code>property</code> full_path: <code>str</code> <a class="header-anchor" href="#property-full-path-str" aria-label="Permalink to &quot;`property` full_path: `str`&quot;">​</a></h3><p>Requested path, including the query string.</p></li><li><h3 id="get-data-cache-true-as-text-false-parse-form-data-false" tabindex="-1">get_data(<code>cache=True, as_text=False, parse_form_data=False</code>) <a class="header-anchor" href="#get-data-cache-true-as-text-false-parse-form-data-false" aria-label="Permalink to &quot;get_data(`cache=True, as_text=False, parse_form_data=False`)&quot;">​</a></h3><p>This reads the buffered incoming data from the client into one bytes object. By default this is cached but that behavior can be changed by setting cache to <code>False</code>.</p><p>Usually it’s a bad idea to call this method without checking the content length first as a client could send dozens of megabytes or more to cause memory problems on the server.</p><p>Note that if the form data was already parsed this method will not return anything as form data parsing does not cache the data like this method does. To implicitly invoke form data parsing function set <code>parse_form_data</code> to <code>True</code>. When this is done the return value of this method will be an empty string if the form parser handles the data. This generally is not necessary as if the whole data is cached (which is the default) the form parser will used the cached data to parse the form data. Please be generally aware of checking the content length first in any case before calling this method to avoid exhausting server memory.</p><p>If <code>as_text</code> is set to <code>True</code> the return value will be a decoded string.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.9.</em></p></details><p><em>Parameters</em>:</p><ul><li><p><code>cache (bool)</code> –</p></li><li><p><code>as_text (bool)</code> –</p></li><li><p><code>parse_form_data (bool)</code> –</p></li></ul><p><em>Return type</em>: <code>bytes | str</code></p></li><li><h3 id="get-json-force-false-silent-false-cache-true" tabindex="-1">get_json(<code>force=False, silent=False, cache=True</code>) <a class="header-anchor" href="#get-json-force-false-silent-false-cache-true" aria-label="Permalink to &quot;get_json(`force=False, silent=False, cache=True`)&quot;">​</a></h3><p>Parse <code>data</code> as <code>JSON</code>.</p><p>If the <code>mimetype</code> does not indicate <code>JSON</code> (<code>application/json</code>, see <code>is_json</code>), or parsing fails, <code>on_json_loading_failed()</code> is called and its return value is used as the return value. By default this raises a <code>415</code> Unsupported Media Type resp.</p><p><em>Parameters</em>:</p><ul><li><p><code>force (bool)</code> – Ignore the mimetype and always try to parse <code>JSON</code>.</p></li><li><p><code>silent (bool)</code> – Silence mimetype and parsing errors, and return <code>None</code> instead.</p></li><li><p><code>cache (bool)</code> – Store the parsed JSON to return for subsequent calls.</p></li></ul><p><em>Return type</em>: <code>Any | None</code></p><p><em>Changed in version 2.3</em>: Raise a <code>415</code> error instead of <code>400</code>.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.1</em>: Raise a <code>400</code> error if the content type is incorrect.</p></details></li><li><h3 id="headers" tabindex="-1">headers <a class="header-anchor" href="#headers" aria-label="Permalink to &quot;headers&quot;">​</a></h3><p>The headers received with the request.</p></li><li><h3 id="property-host-str" tabindex="-1"><code>property</code> host: <code>str</code> <a class="header-anchor" href="#property-host-str" aria-label="Permalink to &quot;`property` host: `str`&quot;">​</a></h3><p>The host name the request was made to, including the port if it’s non-standard. Validated with <code>trusted_hosts</code>.</p></li><li><h3 id="property-host-url-str" tabindex="-1"><code>property</code> host_url: <code>str</code> <a class="header-anchor" href="#property-host-url-str" aria-label="Permalink to &quot;`property` host_url: `str`&quot;">​</a></h3><p>The request URL scheme and host only.</p></li><li><h3 id="property-if-match-etags" tabindex="-1"><code>property</code> if_match: <code>ETags</code> <a class="header-anchor" href="#property-if-match-etags" aria-label="Permalink to &quot;`property` if_match: `ETags`&quot;">​</a></h3><p>An object containing all the etags in the <code>If-Match</code> header.</p><p><em>Return type</em>: <code>ETags</code></p></li><li><h3 id="property-if-modified-since-datetime-none" tabindex="-1"><code>property</code> if_modified_since: <code>datetime | None</code> <a class="header-anchor" href="#property-if-modified-since-datetime-none" aria-label="Permalink to &quot;`property` if_modified_since: `datetime | None`&quot;">​</a></h3><p>The parsed <code>If-Modified-Since</code> header as a datetime object.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.0</em>: The datetime object is timezone-aware.</p></details></li><li><h3 id="property-if-none-match-etags" tabindex="-1"><code>property</code> if_none_match: <code>ETags</code> <a class="header-anchor" href="#property-if-none-match-etags" aria-label="Permalink to &quot;`property` if_none_match: `ETags`&quot;">​</a></h3><p>An object containing all the etags in the <code>If-None-Match</code> header.</p><p><em>Return type</em>: <code>ETags</code></p></li><li><h3 id="property-if-range-ifrange" tabindex="-1"><code>property</code> if_range: <code>IfRange</code> <a class="header-anchor" href="#property-if-range-ifrange" aria-label="Permalink to &quot;`property` if_range: `IfRange`&quot;">​</a></h3><p>The parsed <code>If-Range</code> header.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.0</em>: <code>IfRange.date</code> is timezone-aware.</p><p><em>New in version 0.7.</em></p></details></li><li><h3 id="property-if-unmodified-since-datetime-none" tabindex="-1"><code>property</code> if_unmodified_since: <code>datetime | None</code> <a class="header-anchor" href="#property-if-unmodified-since-datetime-none" aria-label="Permalink to &quot;`property` if_unmodified_since: `datetime | None`&quot;">​</a></h3><p>The parsed <code>If-Unmodified-Since</code> header as a datetime object.</p><details class="details custom-block"><summary>hangelog</summary><p><em>Changed in version 2.0</em>: The datetime object is timezone-aware.</p></details></li><li><h3 id="input-stream" tabindex="-1">input_stream <a class="header-anchor" href="#input-stream" aria-label="Permalink to &quot;input_stream&quot;">​</a></h3><p>The raw <code>WSGI</code> input stream, without any safety checks.</p><p>This is dangerous to use. It does not guard against infinite streams or reading past <code>content_length</code> or <code>max_content_length</code>.</p><p>Use <code>stream</code> instead.</p></li><li><h3 id="property-is-json-bool" tabindex="-1"><code>property</code> is_json: <code>bool</code> <a class="header-anchor" href="#property-is-json-bool" aria-label="Permalink to &quot;`property` is_json: `bool`&quot;">​</a></h3><p>Check if the mimetype indicates JSON data, either <code>application/json</code> or <code>application/*+json</code>.</p></li><li><h3 id="is-multiprocess" tabindex="-1">is_multiprocess <a class="header-anchor" href="#is-multiprocess" aria-label="Permalink to &quot;is_multiprocess&quot;">​</a></h3><p>boolean that is <code>True</code> if the application is served by a <code>WSGI</code> server that spawns multiple processes.</p></li><li><h3 id="is-multithread" tabindex="-1">is_multithread <a class="header-anchor" href="#is-multithread" aria-label="Permalink to &quot;is_multithread&quot;">​</a></h3><p>boolean that is <code>True</code> if the application is served by a multithreaded <code>WSGI</code> server.</p></li><li><h3 id="is-run-once" tabindex="-1">is_run_once <a class="header-anchor" href="#is-run-once" aria-label="Permalink to &quot;is_run_once&quot;">​</a></h3><p>boolean that is <code>True</code> if the application will be executed only once in a process lifetime. This is the case for <code>CGI</code> for example, but it’s not guaranteed that the execution only happens one time.</p></li><li><h3 id="property-is-secure-bool" tabindex="-1"><code>property</code> is_secure: <code>bool</code> <a class="header-anchor" href="#property-is-secure-bool" aria-label="Permalink to &quot;`property` is_secure: `bool`&quot;">​</a></h3><p><code>True</code> if the request was made with a secure protocol (<code>HTTPS</code> or <code>WSS</code>).</p></li><li><h3 id="property-json-any-none" tabindex="-1"><code>property</code> json: <code>Any | None</code> <a class="header-anchor" href="#property-json-any-none" aria-label="Permalink to &quot;`property` json: `Any | None`&quot;">​</a></h3><p>The parsed <code>JSON</code> data if <code>mimetype</code> indicates <code>JSON</code> (<code>application/json</code>, see <code>is_json</code>).</p><p>Calls <code>get_json()</code> with default arguments.</p><p>If the request content type is not <code>application/json</code>, this will raise a <code>415</code> Unsupported Media Type error.</p><p><em>Changed in version 2.3</em>: Raise a <code>415</code> error instead of <code>400</code>.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.1</em>: Raise a <code>400</code> error if the content type is incorrect.</p></details></li><li><h3 id="list-storage-class" tabindex="-1">list_storage_class <a class="header-anchor" href="#list-storage-class" aria-label="Permalink to &quot;list_storage_class&quot;">​</a></h3><p>alias of <code>ImmutableList</code></p></li><li><h3 id="make-form-data-parser" tabindex="-1">make_form_data_parser() <a class="header-anchor" href="#make-form-data-parser" aria-label="Permalink to &quot;make_form_data_parser()&quot;">​</a></h3><p>Creates the form data parser. Instantiates the <code>form_data_parser_class</code> with some parameters.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.8.</em></p></details><p><em>Return type</em>: <code>FormDataParser</code></p></li><li><h3 id="property-max-content-length-int-none" tabindex="-1"><code>property</code> max_content_length: <code>int | None</code> <a class="header-anchor" href="#property-max-content-length-int-none" aria-label="Permalink to &quot;`property` max_content_length: `int | None`&quot;">​</a></h3><p>Read-only view of the <code>MAX_CONTENT_LENGTH</code> config key.</p></li><li><h3 id="max-form-memory-size-int-none-none" tabindex="-1">max_form_memory_size: <code>int | None = None</code> <a class="header-anchor" href="#max-form-memory-size-int-none-none" aria-label="Permalink to &quot;max_form_memory_size: `int | None = None`&quot;">​</a></h3><p>the maximum form field size. This is forwarded to the form data parsing function (<code>parse_form_data()</code>). When set and the <code>form</code> or <code>files</code> attribute is accessed and the data in memory for post data is longer than the specified value a <code>RequestEntityTooLarge</code> exception is raised.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.5.</em></p></details></li><li><h3 id="max-form-parts-1000" tabindex="-1">max_form_parts = <code>1000</code> <a class="header-anchor" href="#max-form-parts-1000" aria-label="Permalink to &quot;max_form_parts = `1000`&quot;">​</a></h3><p>The maximum number of multipart parts to parse, passed to <code>form_data_parser_class</code>. Parsing form data with more than this many parts will raise <code>RequestEntityTooLarge</code>.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 2.2.3.</em></p></details></li><li><h3 id="max-forwards" tabindex="-1">max_forwards <a class="header-anchor" href="#max-forwards" aria-label="Permalink to &quot;max_forwards&quot;">​</a></h3><p>The <code>Max-Forwards</code> request-header field provides a mechanism with the <code>TRACE</code> and <code>OPTIONS</code> methods to limit the number of proxies or gateways that can forward the request to the next inbound server.</p></li><li><h3 id="method" tabindex="-1">method <a class="header-anchor" href="#method" aria-label="Permalink to &quot;method&quot;">​</a></h3><p>The method the request was made with, such as <code>GET</code>.</p></li><li><h3 id="property-mimetype-str" tabindex="-1"><code>property</code> mimetype: <code>str</code> <a class="header-anchor" href="#property-mimetype-str" aria-label="Permalink to &quot;`property` mimetype: `str`&quot;">​</a></h3><p>Like <code>content_type</code>, but without parameters (eg, without charset, type etc.) and always lowercase. For example if the content type is <code>text/HTML; charset=utf-8</code> the mimetype would be <code>&#39;text/html&#39;</code>.</p></li><li><h3 id="property-mimetype-params-dict-str-str" tabindex="-1"><code>property</code> mimetype_params: <code>dict[str, str]</code> <a class="header-anchor" href="#property-mimetype-params-dict-str-str" aria-label="Permalink to &quot;`property` mimetype_params: `dict[str, str]`&quot;">​</a></h3><p>The mimetype parameters as <code>dict</code>. For example if the content type is <code>text/html; charset=utf-8</code> the params would be <code>{&#39;charset&#39;: &#39;utf-8&#39;}</code>.</p></li><li><h3 id="on-json-loading-failed-e" tabindex="-1">on_json_loading_failed(<code>e</code>) <a class="header-anchor" href="#on-json-loading-failed-e" aria-label="Permalink to &quot;on_json_loading_failed(`e`)&quot;">​</a></h3><p>Called if <code>get_json()</code> fails and isn’t silenced.</p><p>If this method returns a value, it is used as the return value for <code>get_json()</code>. The default implementation raises <code>BadRequest</code>.</p><p><em>Parameters</em>:</p><ul><li>e (ValueError | None) – If parsing failed, this is the exception. It will be <code>None</code> if the content type wasn’t <code>application/json</code>.</li></ul><p><em>Return type</em>: <code>Any</code></p><p><em>Changed in version 2.3</em>: Raise a <code>415</code> error instead of <code>400</code>.</p></li><li><h3 id="origin" tabindex="-1">origin <a class="header-anchor" href="#origin" aria-label="Permalink to &quot;origin&quot;">​</a></h3><p>The host that the request originated from. Set <code>access_control_allow_origin</code> on the response to indicate which origins are allowed.</p></li><li><h3 id="parameter-storage-class" tabindex="-1">parameter_storage_class <a class="header-anchor" href="#parameter-storage-class" aria-label="Permalink to &quot;parameter_storage_class&quot;">​</a></h3><p>alias of <code>ImmutableMultiDict</code></p></li><li><h3 id="path" tabindex="-1">path <a class="header-anchor" href="#path" aria-label="Permalink to &quot;path&quot;">​</a></h3><p>The path part of the URL after <code>root_path</code>. This is the path used for routing within the application.</p></li><li><h3 id="property-pragma-headerset" tabindex="-1"><code>property</code> pragma: <code>HeaderSet</code> <a class="header-anchor" href="#property-pragma-headerset" aria-label="Permalink to &quot;`property` pragma: `HeaderSet`&quot;">​</a></h3><p>The Pragma general-header field is used to include implementation-specific directives that might apply to any recipient along the request/response chain. All pragma directives specify optional behavior from the viewpoint of the protocol; however, some systems MAY require that behavior be consistent with the directives.</p></li><li><h3 id="query-string" tabindex="-1">query_string <a class="header-anchor" href="#query-string" aria-label="Permalink to &quot;query_string&quot;">​</a></h3><p>The part of the URL after the <code>“?”</code>. This is the raw value, use <code>args</code> for the parsed values.</p></li><li><h3 id="property-range-range-none" tabindex="-1"><code>property</code> range: <code>Range | None</code> <a class="header-anchor" href="#property-range-range-none" aria-label="Permalink to &quot;`property` range: `Range | None`&quot;">​</a></h3><p>The parsed <code>Range</code> header.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.7.</em></p></details><p><em>Return type</em>: <code>Range</code></p></li><li><h3 id="referrer" tabindex="-1">referrer <a class="header-anchor" href="#referrer" aria-label="Permalink to &quot;referrer&quot;">​</a></h3><p>The <code>Referer[sic]</code> request-header field allows the client to specify, for the server’s benefit, the address (<code>URI</code>) of the resource from which the Request-URI was obtained (the “referrer”, although the header field is misspelled).</p></li><li><h3 id="remote-addr" tabindex="-1">remote_addr <a class="header-anchor" href="#remote-addr" aria-label="Permalink to &quot;remote_addr&quot;">​</a></h3><p>The address of the client sending the request.</p></li><li><h3 id="remote-user" tabindex="-1">remote_user <a class="header-anchor" href="#remote-user" aria-label="Permalink to &quot;remote_user&quot;">​</a></h3><p>If the server supports user authentication, and the script is protected, this attribute contains the username the user has authenticated as.</p></li><li><h3 id="root-path" tabindex="-1">root_path <a class="header-anchor" href="#root-path" aria-label="Permalink to &quot;root_path&quot;">​</a></h3><p>The prefix that the application is mounted under, without a trailing slash. <code>path</code> comes after this.</p></li><li><h3 id="property-root-url-str" tabindex="-1"><code>property</code> root_url: <code>str</code> <a class="header-anchor" href="#property-root-url-str" aria-label="Permalink to &quot;`property` root_url: `str`&quot;">​</a></h3><p>The request URL scheme, host, and root path. This is the root that the application is accessed from.</p></li><li><h3 id="routing-exception-exception-none-none" tabindex="-1">routing_exception: <code>Exception | None = None</code> <a class="header-anchor" href="#routing-exception-exception-none-none" aria-label="Permalink to &quot;routing_exception: `Exception | None = None`&quot;">​</a></h3><p>If matching the URL failed, this is the exception that will be raised / was raised as part of the request handling. This is usually a <code>NotFound</code> exception or something similar.</p></li><li><h3 id="scheme" tabindex="-1">scheme <a class="header-anchor" href="#scheme" aria-label="Permalink to &quot;scheme&quot;">​</a></h3><p>The URL scheme of the protocol the request used, such as <code>https</code> or <code>wss</code>.</p></li><li><h3 id="property-script-root-str" tabindex="-1"><code>property</code> script_root: <code>str</code> <a class="header-anchor" href="#property-script-root-str" aria-label="Permalink to &quot;`property` script_root: `str`&quot;">​</a></h3><p>Alias for <code>self.root_path</code>. <code>environ[&quot;SCRIPT_ROOT&quot;]</code> without a trailing slash.</p></li><li><h3 id="server" tabindex="-1">server <a class="header-anchor" href="#server" aria-label="Permalink to &quot;server&quot;">​</a></h3><p>The address of the server. <code>(host, port)</code>, <code>(path, None)</code> for unix sockets, or None if not known.</p></li><li><h3 id="shallow-bool" tabindex="-1">shallow: <code>bool</code> <a class="header-anchor" href="#shallow-bool" aria-label="Permalink to &quot;shallow: `bool`&quot;">​</a></h3><p>Set when creating the request object. If <code>True</code>, reading from the request body will cause a <code>RuntimeException</code>. Useful to prevent modifying the stream from middleware.</p></li><li><h3 id="property-stream-io-bytes" tabindex="-1"><code>property</code> stream: <code>IO[bytes]</code> <a class="header-anchor" href="#property-stream-io-bytes" aria-label="Permalink to &quot;`property` stream: `IO[bytes]`&quot;">​</a></h3><p>The <code>WSGI</code> input stream, with safety checks. This stream can only be consumed once.</p><p>Use <code>get_data()</code> to get the full data as bytes or text. The <code>data</code> attribute will contain the full bytes only if they do not represent form data. The <code>form</code> attribute will contain the parsed form data in that case.</p><p>Unlike <code>input_stream</code>, this stream guards against infinite streams or reading past <code>content_length</code> or <code>max_content_length</code>.</p><p>If <code>max_content_length</code> is set, it can be enforced on streams if <code>wsgi.input_terminated</code> is set. Otherwise, an empty stream is returned.</p><p>If the limit is reached before the underlying stream is exhausted (such as a file that is too large, or an infinite stream), the remaining contents of the stream cannot be read safely. Depending on how the server handles this, clients may show a “connection reset” failure instead of seeing the <code>413</code> response.</p><p><em>Changed in version 2.3</em>: Check <code>max_content_length</code> preemptively and while reading.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 0.9</em>: The stream is always set (but may be consumed) even if form parsing was accessed first.</p></details></li><li><h3 id="trusted-hosts-list-str-none-none" tabindex="-1">trusted_hosts: <code>list[str] | None = None</code> <a class="header-anchor" href="#trusted-hosts-list-str-none-none" aria-label="Permalink to &quot;trusted_hosts: `list[str] | None = None`&quot;">​</a></h3><p>Valid host names when handling requests. By default all hosts are trusted, which means that whatever the client says the host is will be accepted.</p><p>Because <code>Host</code> and <code>X-Forwarded-Host</code> headers can be set to any value by a malicious client, it is recommended to either set this property or implement similar validation in the proxy (if the application is being run behind one).</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.9.</em></p></details></li><li><h3 id="property-url-str" tabindex="-1"><code>property</code> url: <code>str</code> <a class="header-anchor" href="#property-url-str" aria-label="Permalink to &quot;`property` url: `str`&quot;">​</a></h3><p>The full request URL with the scheme, host, root path, path, and query string.</p></li><li><h3 id="property-url-charset-str" tabindex="-1"><code>property</code> url_charset: <code>str</code> <a class="header-anchor" href="#property-url-charset-str" aria-label="Permalink to &quot;`property` url_charset: `str`&quot;">​</a></h3><p>The charset to use when decoding percent-encoded bytes in <code>args</code>. Defaults to the value of <code>charset</code>, which defaults to <code>UTF-8</code>.</p><p><em>Deprecated since version 2.3</em>: Will be removed in <code>Werkzeug</code> 3.0. Percent-encoded bytes must always be <code>UTF-8</code>.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.6.</em></p></details></li><li><h3 id="property-url-root-str" tabindex="-1"><code>property</code> url_root: <code>str</code> <a class="header-anchor" href="#property-url-root-str" aria-label="Permalink to &quot;`property` url_root: `str`&quot;">​</a></h3><p>Alias for <code>root_url</code>. The URL with scheme, host, and root path. For example, <code>https://example.com/app/</code>.</p></li><li><h3 id="url-rule-rule-none-none" tabindex="-1">url_rule: <code>Rule | None = None</code> <a class="header-anchor" href="#url-rule-rule-none-none" aria-label="Permalink to &quot;url_rule: `Rule | None = None`&quot;">​</a></h3><p>The internal URL rule that matched the request. This can be useful to inspect which methods are allowed for the URL from a before/after handler (<code>request.url_rule.methods</code>) etc. Though if the request’s method was invalid for the URL rule, the valid list is available in <code>routing_exception.valid_methods</code> instead (an attribute of the Werkzeug exception <code>MethodNotAllowed</code>) because the request was never internally bound.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.6.</em></p></details></li><li><h3 id="property-user-agent-useragent" tabindex="-1"><code>property</code> user_agent: <code>UserAgent</code> <a class="header-anchor" href="#property-user-agent-useragent" aria-label="Permalink to &quot;`property` user_agent: `UserAgent`&quot;">​</a></h3><p>The user agent. Use <code>user_agent.string</code> to get the header value. Set <code>user_agent_class</code> to a subclass of <code>UserAgent</code> to provide parsing for the other properties or other extended data.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.1</em>: The built-in parser was removed. Set <code>user_agent_class</code> to a <code>UserAgent</code> subclass to parse data from the string.</p></details></li><li><h3 id="user-agent-class" tabindex="-1">user_agent_class <a class="header-anchor" href="#user-agent-class" aria-label="Permalink to &quot;user_agent_class&quot;">​</a></h3><p>alias of <code>UserAgent</code></p></li><li><h3 id="property-values-combinedmultidict-str-str" tabindex="-1"><code>property</code> values: <code>CombinedMultiDict[str, str]</code> <a class="header-anchor" href="#property-values-combinedmultidict-str-str" aria-label="Permalink to &quot;`property` values: `CombinedMultiDict[str, str]`&quot;">​</a></h3><p>A <code>werkzeug.datastructures.CombinedMultiDict</code> that combines <code>args</code> and <code>form</code>.</p><p>For <code>GET</code> requests, only <code>args</code> are present, not <code>form</code>.</p><details class="details custom-block"><summary>Changelog</summary><p><em>Changed in version 2.0</em>: For <code>GET</code> requests, only <code>args</code> are present, not <code>form</code>.</p></details></li><li><h3 id="view-args-dict-str-t-any-none-none" tabindex="-1">view_args: <code>dict[str, t.Any] | None = None</code> <a class="header-anchor" href="#view-args-dict-str-t-any-none-none" aria-label="Permalink to &quot;view_args: `dict[str, t.Any] | None = None`&quot;">​</a></h3><p>A dict of view arguments that matched the request. If an exception happened when matching, this will be <code>None</code>.</p></li><li><h3 id="property-want-form-data-parsed-bool" tabindex="-1"><code>property</code> want_form_data_parsed: <code>bool</code> <a class="header-anchor" href="#property-want-form-data-parsed-bool" aria-label="Permalink to &quot;`property` want_form_data_parsed: `bool`&quot;">​</a></h3><p><code>True</code> if the request method carries content. By default this is true if a <code>Content-Type</code> is sent.</p><details class="details custom-block"><summary>Changelog</summary><p><em>New in version 0.8.</em></p></details></li></ul><h2 id="flask-request" tabindex="-1">flask.request <a class="header-anchor" href="#flask-request" aria-label="Permalink to &quot;flask.request&quot;">​</a></h2><p>To access incoming request data, you can use the global <code>request</code> object. <code>Flask</code> parses incoming request data for you and gives you access to it through that global object. Internally <code>Flask</code> makes sure that you always get the correct data for the active thread if you are in a multithreaded environment.</p><p>This is a proxy. See <a href="/python/flask/user_guide/request_context#notes-on-proxies">Notes On Proxies</a> for more information.</p><p>The request object is an instance of a <code>Request</code>.</p>',24),i=[s];function c(d,n,l,h,p,u){return t(),a("div",null,i)}const y=e(r,[["render",c]]);export{f as __pageData,y as default};
